import React from 'react'


function gerarNumeros(qtde) {
    let numeros
    numeros.fill(0[1, 60])

    return (
        <div>
            <span>
                Os números apostados são: {numeros}
            </span>
        </div>
    )
}

<button>Gerar Numero</button>

export default gerarNumeros
